USE Netflix_schema;
drop table if exists Country;
CREATE TABLE Country (
  `country_id` INT PRIMARY KEY AUTO_INCREMENT,
  `country_code` VARCHAR(1024) NOT NULL,
  `country_name` VARCHAR(1024) NOT NULL
)
;
;
CREATE TABLE Library (
  `library_id` INT PRIMARY KEY,
  `country_id` INT,
  `Total_Library_Size` BIGINT,
  `No_of_TV_Shows` BIGINT,
  `No_of_Movies` BIGINT,
  CONSTRAINT fk_country_id
FOREIGN KEY (country_id)
REFERENCES Country (country_id)
);

;
drop table if exists Genre;
CREATE TABLE `Genre` (
  `Genre_id` INT PRIMARY KEY,
  `Genre_name` VARCHAR(1024)
);
;
drop table if exists Genre_movie;
CREATE TABLE `Genre_movie` (
  `GM_id` INT PRIMARY KEY,
  `Genre_id` INT,
  `country_id` INT,
  `N_Movies_by_Genre` VARCHAR(1024)NOT NULL,

  CONSTRAINT fk_Genre_id
FOREIGN KEY (Genre_id)
REFERENCES Genre (Genre_id),
  CONSTRAINT fk3_country_id
FOREIGN KEY (country_id)
REFERENCES Country (country_id)
);

;
CREATE TABLE `Subscription_Plan` (
  `Subscription_Plan_ID` INT PRIMARY KEY,
  `Subscription_Plan_Name` VARCHAR(1024) NOT NULL
);
;

CREATE TABLE `Subscription_Plan_by_Country` (
	`Subscription_Plan_by_Country_ID` INT PRIMARY KEY,
    `Country_id` INT NOT NULL,
    `Subscription_Plan_ID` INT NOT NULL ,
    `Number_of_Subscribers` BIGINT,
    CONSTRAINT fk4_country_id FOREIGN KEY (country_id)
        REFERENCES Country (country_id),
    CONSTRAINT fk_Subscription_plan_id FOREIGN KEY (Subscription_Plan_ID)
        REFERENCES Subscription_plan (Subscription_Plan_ID)
);

;

CREATE TABLE `Price` (
  `Price_ID` BIGINT PRIMARY KEY NOT NULL,
  `Subscription_Plan_ID` INT,
  `Amount_in_USD` VARCHAR(1024) NOT NULL,
  `country_id` INT,
  CONSTRAINT fk5_country_id FOREIGN KEY (country_id)
        REFERENCES Country (country_id),
    CONSTRAINT fk2_Subscription_plan_id FOREIGN KEY (Subscription_Plan_ID)
        REFERENCES Subscription_plan (Subscription_Plan_ID)
);

;
CREATE TABLE `Release_Month` (
  `Month_id` BIGINT PRIMARY KEY,
  `Month_name` VARCHAR(1024) NOT NULL
)
;
;
CREATE TABLE `Release_month_movies` (
  `MR_ID` VARCHAR(64) PRIMARY KEY,
  `Month_id` BIGINT,
  `country_id` INT,
  `Genre_id` INT,
  `No_of_mv_released` BIGINT,
    CONSTRAINT fk_Month_id FOREIGN KEY (Month_id)
        REFERENCES Release_Month (Month_id),
          CONSTRAINT fk6_country_id FOREIGN KEY (country_id)
        REFERENCES Country (country_id),
          CONSTRAINT fk3_Genre_id FOREIGN KEY (Genre_id)
        REFERENCES Genre (Genre_id)
);


;
